import React from 'react';
import imgCirque from '../img/imgCirque.jpg';
import { Link } from 'react-router-dom';

function Intro() {
    return (
    <div>  
      <div className='title-intro'> 
          WILD CIRCUS
      </div>
      <img className= 'img-cirque'src = {imgCirque} alt='cirque' />
      <div className='link-home'>
        <Link to = "/Home">Bienvenue</Link>
      </div>
    </div>
  );
}




export default Intro;
